import React from "react";

import './Users.css';
// import UserForm from "./UserForm";
import UserList from "./UserList";

const users= [
    {
        id: 1,
        name: 'gover dhan bnabu',
        age: 23,
    },
    {
        id: 2,
        name: 'tatya bichuu',
        age: 56,
    }
]
const Users = () =>{
    return (
        <div>
            <UserList userData={users}/>
        </div>
    )
}

export default Users;
